import "core-js/modules/es6.array.iterator";
import "core-js/modules/es6.promise";
import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue";
import Home from "./components/weixin/Home.vue"; // 为Exam01.vue 组件指定访问路径
// 1：在router.js 引入组件

import Exam01 from "./components/exam/Exam01.vue";
import Exam02 from "./components/exam/Exam02.vue";
import Exam03 from "./components/exam/Exam03.vue";
import Exam04 from "./components/exam/Exam04.vue";
import Exam05 from "./components/exam/Exam05.vue";
import Exam06 from "./components/exam/Exam06.vue";
import Exam08fa from "./components/exam/Exam08fa.vue";
import Home3 from "./components/messsage/Home.vue"; //微信demo

import MessageList from "./components/messsage/common/MessageList.vue";
import product from "./components/xz/product.vue";
import cart from "./components/xz/Cart.vue"; //学子商城组件

import Login from "./components/xz/Login.vue"; // 2：为组件指定访问路径 /Exam01

Vue.use(Router);
export default new Router({
  routes: [{
    path: '/login',
    component: Login
  }, {
    path: '/Home',
    component: Home
  }, {
    path: '/',
    component: HelloContainer
  }, {
    path: '/Exam01',
    component: Exam01
  }, //前面地址栏访问路径 后面定义的名称
  {
    path: '/Exam02',
    component: Exam02
  }, {
    path: '/Exam03',
    component: Exam03
  }, {
    path: '/Exam04',
    component: Exam04
  }, {
    path: '/Exam05',
    component: Exam05
  }, {
    path: '/Exam06',
    component: Exam06
  }, {
    path: '/Exam08fa',
    component: Exam08fa
  }, {
    path: '/Home3',
    component: Home3
  }, {
    path: '/MessageList',
    component: MessageList
  }, {
    path: '/product',
    component: product
  }, {
    path: '/cart',
    component: cart
  }]
});
